import CustomHttpService from './custom-http.service';
import Config from '../config/config';
import CookieManagerService from './cookie.service';
import {AppConstant} from '../../src/constants/app.constant';

import EncodeDecodeType from '../actiontype/encode-decode-type';
class FeedbackDialogService {
    static fetchFeedbackApi(feedbackObj) {
        const authDetails = CookieManagerService.getAuthDetails();
        const feedbackDialogObj = {
            'agentId': authDetails && authDetails['agentId'] ? authDetails['agentId'] : null,
            'feedbackPayload': feedbackObj,
            'lsiNumber': CookieManagerService.getItem(AppConstant.LSI_NUMBER)
        }
        const config = {
            headers: {
            }
        };
        var url = Config.contextPath + "user/rest/v1.0/feedback/submitFeedBack";
        return CustomHttpService.post(url, feedbackDialogObj, config, EncodeDecodeType.DEFAULT);
    }
}

export default FeedbackDialogService;
